import axios from 'axios';

export const fetchWorkouts = ( token ) => {
    return dispatch => {
        axios.get('/api/workouts/', {
            headers: {
                'auth-token' : token
            }
        })
        .then( res => {
            console.log(res.data);
            dispatch( getWorkoutsSuccessful( res.data ));
        })
        .catch( err => {

        });
    };
};
